a:260:{i:0;a:1:{s:2:"id";s:19:"2391084162871586412";}i:1;a:1:{s:10:"short_code";s:11:"CEu1mCsBe5s";}i:2;a:1:{s:12:"created_time";i:1599259466;}i:3;a:1:{s:7:"caption";s:981:":: He was talking off the cuff when he said, “I just think he’s envious, that he wishes he was more like me.” And I laughed, you know, cause no one wishes they were more like him. As I sat there listening to him purr, I questioned if everyone is just as arrogant, thinking of themselves as the supreme pinnacle, the beam of light to guide those of us astray home. 

Think you have all the right answers, eh? Against all mathematical possibilities, sixty-five percent of Americans believe they have above average intelligence. Let’s take a moment to ponder the consequences of that. Before we can become a genuine agent for any meaningful change, seems we first require a serious dose of humility. 
