To legendarne spotkanie jest już tylko wspomnieniem, już nigdy nie powtórzy się w takim składzie, ale zostało  udokumentowane pamiątkową fotografią. Przeczytajcie.

 "Dziś pierwsze, z oby nieskończonej ilości, posiedzenie naszego małego klubu, w księgarni Korekty na tyłach placu Zbawiciela. Pilch zarządził ustanowienie takich cyklicznych spotkań , nie na wzór legendarnych nasiadówek w kawiarni Czytelnika czy przedwojennej Ziemiańskiej - nie ma co kopiować, naśladować, podrabiać - ale po to, aby mieć kontakt z żywymi wciąż ludźmi. (...)
Prócz tego Uchański, Drzewucki, Sendecki i ja. To było wszystko dobre, ludzkie i kojące. Tak, czułem ukojenie po tych dwóch godzinach, w trakcie których żadnych ważkich tematów nie podejmowaliśmy, plugawych opowieści nie snuli, nawet plotek środowiskowych nie kolportowali. Z punktu widzenia legendy literackiej - nic. Z punktu widzenia godności człowieczego przemijania - wszystko".
